INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3033610035459', 'Parmentier de Bœuf (À la mousseline de potiron butternut parsemée d\'amandes effilées)', 'Purée de potiron (24 %), eau, courge butternut (15 %), brunoise de légume (carotte, _céleri_, navet, oignon), joue de bœuf cuite (8,2 %), _crème_ (stabilisant: carraghénanes), flocon de pomme de terre (pomme de terre déshydratée, épice, curcuma), petits pois, roux (farine de _blé_, _beurre_), _beurre_, amidon de maïs, ail, concentré de vin rouge, persil, fond de bœuf (viande et jus de cuisson de viande de bœuf, sel), jus de veau lié aromatisé déshydraté (fécule de pomme de terre, arômes, sel, graisse de poulet, sucre, chicorée soluble, plantes aromatiques, farine de _blé_, viande de veau déshydraté, tomate déshydratée, épices, antioxydant : extrait de romarin), sel, tomate en poudre (0,3%), colorant : caramel ordinaire, bouillon de légumes [légumes et jus de cuisson de légumes (carotte, tomate, oignon, ail), huile de tournesol, sel], double concentré de tomate, _amande_ effilée (0,1 %), thym, piment, poivre.', 'https://static.openfoodfacts.org/images/products/303/361/003/5459/front_fr.7.400.jpg', '5.8', '3.7', '11', '2', '', '4.2', '0.77', '0.303149606299213', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
